import React, { useState } from "react";
import {useForm} from "react-hook-form";




function App() {

  const {register, handleSubmit} = useForm();

  const onSubmit = (data) => {
    console.log(data);
  };

  return (
      <form onSubmit={handleSubmit(onSubmit)}>
        <input ref = {register} type = "file" name="filename"/>
        <button>Submit</button>
      </form>
  );
}

export default App;
